#define DLL_NAME "inject.dll"

void InjectDLL(DWORD dwPID, const char* szDLLName)
{
	HANDLE hSnapshot = CreateToolhelp32Snapshot(TH32CS_SNAPMODULE, dwPID);
	HMODULE hModule = GetModuleHandle(szDLLName);
	MODULEENTRY32 me = { sizeof(me) };

	if (!Module32First(hSnapshot, &me))
	{
		CloseHandle(hSnapshot);
		return;
	}

	do
	{
		if (hModule == me.hModule)
		{
			CloseHandle(hSnapshot);
			return;
		}
	} while (Module32Next(hSnapshot, &me));

	CloseHandle(hSnapshot);

	HANDLE hProcess = OpenProcess(PROCESS_ALL_ACCESS, FALSE, dwPID);
	if (!hProcess)
		return;

	void* pRemoteBuf = VirtualAllocEx(hProcess, NULL, strlen(szDLLName) + 1, MEM_COMMIT, PAGE_READWRITE);
	if (!pRemoteBuf)
	{
		CloseHandle(hProcess);
		return;
	}

	if (!WriteProcessMemory(hProcess, pRemoteBuf, (void*)szDLLName, strlen(szDLLName) + 1, NULL))
	{
		VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
		CloseHandle(hProcess);
		return;
	}

	PTHREAD_START_ROUTINE pThreadProc = (PTHREAD_START_ROUTINE)GetProcAddress(GetModuleHandle("Kernel32"), "LoadLibraryA");
	if (!pThreadProc)
	{
		VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
		CloseHandle(hProcess);
		return;
	}

	HANDLE hThread = CreateRemoteThread(hProcess, NULL, 0, pThreadProc, pRemoteBuf, 0, NULL);
	if (hThread)
	{
		WaitForSingleObject(hThread, INFINITE);
		CloseHandle(hThread);
	}

	VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
	CloseHandle(hProcess);
}

